#[test]
fn test_closest_distances() {
    let niche_of_individuals = test_helpers::get_niche_of_individuals_to_closest_distance_test();
    
    
    let unique_niche = unique_values_sorted(&niche_of_individuals);
    assert_eq!(unique_niche, test_helpers::get_unique_niche_to_test_closest());
    
    let unique_distances = form_matrix_by_indicies_in_dist_matrix(&test_helpers::get_distance_matrix_for_test_closest_distance(), &unique_niche);
    assert_eq!(unique_distances, test_helpers::get_unique_distances_to_test_closest());
    
    let min_of_unique_dist = np_argmin_axis_zero(&unique_distances);
    assert_eq!(min_of_unique_dist, test_helpers::get_min_of_unique_dists_to_test_closest());
    
    let closest = unique_values_sorted(&min_of_unique_dist);
    assert_eq!(closest, test_helpers::get_closest_to_test_closest());
    
    let intersections = intersect(&test_helpers::get_zero_fronts_to_test_closest_dist(), &closest);
    
    assert_eq!(intersections, test_helpers::get_intersection_to_test_closest_dist());
}